#print("==Asturian==\n\n===Etymology===\nFrom {{inh|ast|la|plic\u0101re}}, present active infinitive of {{m|la|plic\u014d}}. See also the doublet {{m|ast|plegar}}.\n\n===Verb===\n{{ast-verb-ar|lleg}}\n\n# to [[arrive]]\n\n====Conjugation====\n{{ast-conj-ar|lleg|lleg|llegu}}\n\n----\n\n==Catalan==\n\n===Etymology===\nFrom {{inh|ca|la|leg\u0101re}}, present active infinitive of {{m|la|leg\u014d}}.\n\n===Pronunciation===\n* {{ca-IPA}}\n\n===Verb===\n{{ca-verb}}\n\n# to [[hand down]], to [[pass down]]\n\n====Conjugation====\n{{ca-conj-ar|lleg}}\n\n===Further reading===\n* {{R:IEC2}}\n\n----\n\n==Old Irish==\n\n===Verb===\n{{head|sga|verb form}}\n\n# {{alt sp|sga|legar}}\n\n----\n\n==Spanish==\n\n===Etymology===\nFrom {{inh|es|la|plic\u0101re}}, present active infinitive of {{m|la|plic\u014d||I fold}}, ultimately from {{der|es|ine-pro|*ple\u1e31-||to plait, to weave}}. The semantic shift over time from \"to fold\" is also found in some other Romance cognates, and may be linked to the idea of folding sails when arriving at a port, especially in Iberian Romance where naval tradition was strong. Compare {{cog|pt|chegar}}; however cf. also {{cog|ro|pleca||to leave}}, with the opposite meaning, possibly because there the word was associated with folding up tents and leaving. See also the Spanish doublet {{doublet|es|plegar|t1=to fold|notext=1}}. Another theory instead derives ''llegar'' from a {{inh|es|VL.|plic\u0101re}} as a regressive derivation from Classical Latin {{m|la|applic\u0101re||apply, add, attach, join to}}<ref>https://www.scribd.com/document/158436236/Diccionario-Critico-Etimologico-castellano-G-MA-Corominas-Joan-pdf</ref>. Cognate with {{cog|en|ply}}.\n\n===Pronunciation===\n* {{es-IPA}}\n\n===Verb===\n{{es-verb|lleg|ar|pret=llegu\u00e9}}\n\n# {{lb|es|intransitive}} to [[arrive]], [[get]] (to)\n#: {{ux|es|Cuando '''llegues''' a casa, m\u00e1ndame un mensaje.|When you get home, send me a message.}}\n# {{lb|es|intransitive}} to [[get up to]], to [[go up]] to {{gloss|+ {{m|es|a}} or + {{m|es|hasta}}}}\n# {{lb|es|intransitive}} to be [[sufficient]]\n# {{lb|es|intransitive}} to [[manage]] (be successful)\n#:{{ux|es|no '''llegu\u00e9''' a conseguir el trabajo|I didn't manage to get the job.}}\n\n====Conjugation====\n{{es-conj-ar|lle|p=-gar|combined=1}}\n\n====Antonyms====\n* {{l|es|salir}}, {{l|es|partir}}\n\n=====Derived terms=====\n{{der3|es|hacer llegar\n|llegar a fin de mes\n|llegar a la suela del zapato\n|llegar al llegadero\n|llegar y besar el santo\n|llegarle\n|llegar a ser\n|{{l|es|llegar a tener||to get to have}}\n|no llegar la sangre al r\u00edo}}\n\n====Related terms====\n* {{l|es|llegada}}\n* {{l|es|llegado}}\n* {{l|es|plegar}}\n\n===References===\n<references/>\n\n===Further reading===\n* {{R:DRAE 2001}}\n\n[[Category:Spanish basic words]]")
